BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL);
CREATE TABLE "regions" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "description" text, "slug" varchar, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "region_group_id" integer);
CREATE TABLE "region_countries" ("id" SERIAL PRIMARY KEY NOT NULL, "region_id" integer, "country_id" integer, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "conventions" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "reporting_cycles" ("id" SERIAL PRIMARY KEY NOT NULL, "convention_id" integer, "date" date, "name" varchar, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "clusters" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "cluster_members" ("id" SERIAL PRIMARY KEY NOT NULL, "cluster_id" integer, "convention_id" integer, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "membership_types" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "convention_memberships" ("id" SERIAL PRIMARY KEY NOT NULL, "convention_id" integer, "country_id" integer, "membership_type_id" varchar, "date" date, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "countries" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "population" integer(8), "area" integer(8), "un_member" boolean, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "population_growth" decimal, "gdp" integer(8), "gdp_per_capita" integer(8), "iso_code_2" text, "iso_code_3" text, "country_numeric" integer, "threatened_species" integer, "forested_area" decimal, "co2_emission" integer(8), "co2_per_capita" decimal, "agriculture_production" integer);
CREATE TABLE "region_sources" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "description" text, "website" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "region_groups" ("id" SERIAL PRIMARY KEY NOT NULL, "region_source_id" integer, "name" varchar, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "indicator_types" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "weight" decimal, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "record_types" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "indicators" ("id" SERIAL PRIMARY KEY NOT NULL, "indicator_type_id" integer, "record_type_id" integer, "parent_id" integer, "question_number" varchar, "indicator_number" integer, "question_text" text, "indicator_text" text, "prior_cycle" integer, "prior_question" integer, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "reporting_cycle_id" integer);
CREATE TABLE "scoring_options" ("id" SERIAL PRIMARY KEY NOT NULL, "indicator_id" integer, "description" varchar, "value" integer, "not_applicable" boolean, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
DELETE FROM sqlite_sequence;

CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
